specification: angus/1.0.0
type: MOCK_APIS
task:
  mockApis:
    - name: 基准性能测试
      description: 模拟一个无业务处理快速响应的接口，当前Mock接口接收到客户端请求后立即返回成功。
      method: GET
      endpoint: /benchmark
      responses:
        - name: 无延迟成功响应
          match:
            priority: 1000
          content:
            status: 200
            headers:
              - name: Content-Type
                value: text/plain
            content: Success
            delay:
              mode: NONE
    - name: 模拟不同状态错误
      description: |-
        模拟响应不同Http状态码。
        查询参数status值：@Enum(200|404|500)
      method: GET
      endpoint: /errors
      responses:
        - name: 状态码200
          match:
            parameters:
              - name: status
                in: query
                condition: EQUAL
                expected: 200
            priority: 1000
          content:
            status: 200
            content: OK
            delay:
              mode: NONE
        - name: 状态码400
          match:
            parameters:
              - name: status
                in: query
                condition: EQUAL
                expected: 400
            priority: 1000
          content:
            status: 400
            content: Bad Request
            delay:
              mode: NONE
        - name: 状态码500
          match:
            parameters:
              - name: status
                in: query
                condition: EQUAL
                expected: 500
            priority: 1000
          content:
            status: 500
            content: Internal Server Error
            delay:
              mode: NONE
    - name: 业务处理延迟
      description: 模拟不同业务处理延迟。用于根据客户端耗时要求返回对应固定延迟。
      method: GET
      endpoint: /business
      responses:
        - name: 模拟1毫秒业务处理延迟响应
          match:
            parameters:
              - name: delay
                in: query
                condition: EQUAL
                expected: 1
            priority: 1000
          content:
            status: 200
            content: "{\n    \"code\": \"S\",\n    \"msg\": \"Respond with a delay of\
          \ 1 millisecond.\"\n}"
            delay:
              mode: FIXED
              fixedTime: 1ms
        - name: 模拟10毫秒业务处理延迟响应
          match:
            parameters:
              - name: delay
                in: query
                condition: EQUAL
                expected: 10
            priority: 1000
          content:
            status: 200
            content: "{\n    \"code\": \"S\",\n    \"msg\": \"Respond with a delay of\
          \ 10 millisecond.\"\n}"
            delay:
              mode: FIXED
              fixedTime: 10ms
        - name: 模拟50毫秒业务处理延迟响应
          match:
            parameters:
              - name: delay
                in: query
                condition: EQUAL
                expected: 50
            priority: 1000
          content:
            status: 200
            content: "{\n    \"code\": \"S\",\n    \"msg\": \"Respond with a delay of\
          \ 50 millisecond.\"\n}"
            delay:
              mode: FIXED
              fixedTime: 50ms
        - name: 模拟100毫秒业务处理延迟响应
          match:
            parameters:
              - name: delay
                in: query
                condition: EQUAL
                expected: 100
            priority: 1000
          content:
            status: 200
            content: "{\n    \"code\": \"S\",\n    \"msg\": \"Respond with a delay of\
          \ 100 millisecond.\"\n}"
            delay:
              mode: FIXED
              fixedTime: 100ms
        - name: 模拟200毫秒业务处理延迟响应
          match:
            parameters:
              - name: delay
                in: query
                condition: EQUAL
                expected: 200
            priority: 1000
          content:
            status: 200
            content: "{\n    \"code\": \"S\",\n    \"msg\": \"Respond with a delay of\
          \ 200 millisecond.\"\n}"
            delay:
              mode: FIXED
              fixedTime: 200ms
        - name: 默认响应，没有满足条件匹配时返回，随机延迟1-200秒
          match:
            priority: 1000
          content:
            status: 200
            content: "{\n    \"code\": \"S\",\n    \"msg\": \"Respond with a delay of\
          \ 1-200 millisecond.\"\n}"
            delay:
              mode: RANDOM
              minRandomTime: 1ms
              maxRandomTime: 200ms
    - name: 用户登录业务
      description: 模拟用户登录业务处理接口。用户输入账户和密码为admin时返回登录成功，否则返回登录失败。
      method: POST
      endpoint: /user/signin
      responses:
        - name: 用户输入账号和密码正确时返回登录成功
          match:
            parameters:
              - name: Content-Type
                in: header
                condition: EQUAL
                expected: application/json
            body:
              condition: EQUAL
              expected: "{\n    \"username\":\"admin\",\n    \"password\":\"admin\"\n}"
            priority: 1000
          content:
            status: 200
            headers:
              - name: Content-Type
                value: application/json
            content: "{\n    \"code\": \"S\",\n    \"msg\": \"Success\",\n    \"data\"\
          : {\n         \"access_token\": \"181622ea2a1f4934ad6bec0308390da9\",\n\
          \         \"expires_in\": \"3599\",\n         \"token_type\": \"bearer\"\
          \n    }\n}"
            delay:
              mode: NONE
        - name: 用户输入账号和密码不正确时返回登录失败
          match:
            priority: 1000
          content:
            status: 400
            headers:
              - name: Content-Type
                value: application/json
            content: "{\n    \"code\": \"E0\",\n    \"msg\": \"Login account or password\
          \ error\"\n}"
            delay:
              mode: NONE
    - name: 用户注册业务
      description: 模拟用户注册业务处理接口。用户有输入账户和密码时返回注册成功，否则返回注册失败。
      method: POST
      endpoint: /user/signup
      responses:
        - name: 用户输入账号和密码正确时返回注册成功
          match:
            parameters:
              - name: Content-Type
                in: header
                condition: EQUAL
                expected: application/json
            body:
              condition: REG_MATCH
              expression: (?=.*\busername\b)(?=.*\bpassword\b).*
            priority: 1000
          content:
            status: 200
            headers:
              - name: Content-Type
                value: application/json
            content: "{\n    \"code\": \"S\",\n    \"msg\": \"Success\"\n}"
            delay:
              mode: NONE
        - name: 用户输入账号和密码不正确时返回注册失败
          match:
            priority: 1000
          content:
            status: 400
            headers:
              - name: Content-Type
                value: application/json
            content: "{\n    \"code\": \"E0\",\n    \"msg\": \"Username and password are\
          \ required\"\n}"
            delay:
              mode: NONE
    - name: 修改用户信息
      description: 模拟修改用户信息示例。
      method: PUT
      endpoint: "/user/{username}"
      responses:
        - name: 返回修改成功
          match:
            priority: 1000
          content:
            status: 200
            headers:
              - name: X-Extraction-Token
                value: Your token is 888888 or 999999
            content: "{\n    \"code\": \"S\",\n    \"msg\": \"Success\"\n}"
            delay:
              mode: NONE
    - name: 查询用户信息
      description: 模拟查询用户信息接口。如何查询admin时返回用户信息，否则返回404。
      method: GET
      endpoint: "/user/{username}"
      responses:
        - name: 查询用户名为 “admin” 时返回 admin 用户信息
          match:
            path:
              condition: EQUAL
              expected: /user/admin
            priority: 1000
          content:
            status: 200
            content: "{\n    \"username\": \"admin\",\n    \"age\": 18,\n    \"hobbies\"\
          : \"swimming, playing basketball\",\n    \"avatar\": \"http://serv01-sample.angusmock.cloud:30010/user/admin/avatar.png\"\
          \n}"
            delay:
              mode: NONE
        - name: 默认响应，不是查询 “admin” 用户时返回 404
          match:
            priority: 1000
          content:
            status: 404
            delay:
              mode: NONE
    - name: 下载用户头像
      description: 模拟文件下载示例。
      method: GET
      endpoint: "/user/{username}/avatar.png"
      responses:
        - name: 响应一个 png 格式的二进制文件
          match:
            path:
              condition: CONTAIN
              expected: admin
            priority: 1000
          content:
            status: 200
            headers:
              - name: Content-Type
                value: image/jpeg
            contentEncoding: gzip_base64
            content: 
            delay:
              mode: NONE
